import { useState,useEffect } from "react";

// @mui material components
import Card from "@mui/material/Card";
import Icon from "@mui/material/Icon";
import Menu from "@mui/material/Menu";
import MenuItem from "@mui/material/MenuItem";
import axios from "axios"

// Material Dashboard 2 React components
import MDBox from "components/MDBox";
import MDTypography from "components/MDTypography";

// Material Dashboard 2 React examples
import DataTable from "examples/Tables/DataTable";

// Data
import data from "layouts/dashboard/components/Projects/data";
import TableContainer from "@mui/material/TableContainer";
import Table from "@mui/material/Table";
import { TableCell, TableHead } from "@mui/material";
import TableRow from "@mui/material/TableRow";
import TableBody from "@mui/material/TableBody";

function Projects() {
  const { columns, rows } = data();
  const [menu, setMenu] = useState([]);

  const [prdetails,setPrdetails] = useState([])

  useEffect(()=>{fetchService()},[])
  const fetchService = ()=>{



    // fetch('https://mockbin.org/bin/684bac23-9896-4941-b572-3c4be72fa26f', {
    //   mode: 'no-cors',
    //   method: "get",
    //   headers: {
    //     "Content-Type": "application/json"
    //   }
    // })
    //   .then((res)=>{
    //     console.log(res)
    //     //const resjson = json.parse(resjson)
    //     //console.log(resjson)
    //   })




  }

  useEffect(() => {
    axios
      .get(`https://mockbin.org/bin/684bac23-9896-4941-b572-3c4be72fa26f/view`)
      .then((resp) => {
        console.log("resp", resp);
        const data = resp.data;
        const content = data.content;
        console.log("content", content);
        const text = content.text;
        console.log("text", text);
        const datajson = JSON.parse(text);
        console.log("datajson",datajson)
        setMenu(datajson)
      })
      .catch(function (error) {
        console.log(error);
      });
  }, []);

  const openMenu = ({ currentTarget }) => setMenu(currentTarget);
  const closeMenu = () => setMenu(null);

  const selectoption =(e)=>{
    console.log(e)
const selectedoption = e.target.value;
    console.log("selected",selectedoption)
    axios
      .get(`https://mockbin.org/bin/45e0e661-f74b-49d4-89de-e2b97b9227de?service_id=` + selectedoption)
      .then((resp) => {
        console.log("resp", resp);
        const data = resp.data;

        console.log("data", data);

        setPrdetails(data)
      })
      .catch(function (error) {
        console.log(error);
      });
  }

  const renderMenu = (
    <Menu
      id="simple-menu"
      anchorEl={menu}
      anchorOrigin={{
        vertical: "top",
        horizontal: "left",
      }}
      transformOrigin={{
        vertical: "top",
        horizontal: "right",
      }}
      open={Boolean(menu)}
      onClose={closeMenu}
    >

      <MenuItem onClick={closeMenu}>Action</MenuItem>
      <MenuItem onClick={closeMenu}>Another action</MenuItem>
      <MenuItem onClick={closeMenu}>Something else</MenuItem>
    </Menu>
  );

  return (
    <Card>
      <MDBox display="flex" justifyContent="space-between" alignItems="center" p={3}>
        <MDBox>
          <MDTypography variant="h6" gutterBottom>
            Service Details
          </MDTypography>
        </MDBox>
        {/*<Menu*/}
        {/*  id="simple-menu"*/}
        {/*  anchorEl={menu}*/}
        {/*  anchorOrigin={{*/}
        {/*    vertical: "top",*/}
        {/*    horizontal: "left",*/}
        {/*  }}*/}
        {/*  transformOrigin={{*/}
        {/*    vertical: "top",*/}
        {/*    horizontal: "right",*/}
        {/*  }}*/}
        {/*  open={Boolean(menu)}*/}
        {/*  onClose={closeMenu}*/}
        {/*>*/}
        {/*  {menu.map((item)=>{*/}
        {/*    return(*/}
        {/*      <>*/}
        {/*        <MenuItem onClick={(item)=>selectoption(item)}>{item.service}</MenuItem>*/}
        {/*      </>*/}
        {/*    )*/}
        {/*  })}*/}

        {/*</Menu>*/}
        <select
          name="service"
          className="form-control"
          value={menu.service}
          onChange={(e) => selectoption(e)}
          placeholder="Service name"
        >
          <option
            name=""
            value=""
            style={{ display: "none" }}
          >
            Service Name
          </option>

          {menu.map((element) => {
            return (
              <>
                <option
                  name={element.id}
                  value={element.id}
                >
                  {element.service}
                </option>
              </>
            );
          })}
        </select>
      </MDBox>
      <MDBox>
        <DataTable
          table={{ columns, rows }}
          showTotalEntries={false}
          isSorted={false}
          noEndBorder
          entriesPerPage={false}
        />
        <TableContainer>
          <Table>
            <TableHead>
              <TableRow>
                <TableCell>PR No.</TableCell>
                <TableCell>Branch</TableCell>
                <TableCell>commit_id</TableCell>
                <TableCell>github_status</TableCell>
                <TableCell>notes</TableCell>
                <TableCell>created_at</TableCell>
              </TableRow>
            </TableHead>
            <TableBody>
              {prdetails.map((list, index) => (
                <TableRow key={index}>
                  <TableCell>{list.pr_num}</TableCell>
                  <TableCell>{list.branch}</TableCell>
                  <TableCell>{list.commit_id}</TableCell>
                  <TableCell>{list.github_status}</TableCell>
                  <TableCell>{list.notes}</TableCell>
                  <TableCell>{list.created_at}</TableCell>
                </TableRow>
              ))}
            </TableBody>
          </Table>
        </TableContainer>
      </MDBox>
    </Card>
  );
}

export default Projects;
